          "description": "观看 Apple 特别活动，了解 iPhone 14、iPhone 14 Pro、Apple Fitness+、Apple Watch Ultra、Apple Watch Series 8、AirPods Pro 及更多新惊喜。\n\n00:00:00 Introduction\n00:06:40 Apple Watch Series 8\n00:20:17 Apple Watch SE\n00:23:01 Apple Watch Ultra\n00:40:18 AirPods Pro\n00:48:11 iPhone 14\n01:09:27 iPhone 14 Pro\n\n'Dancing In The Shadows (feat. Clementine Douglas)' - TSHA https://apple.co/TSHA\n'There You Go' - Billy Lemos https://apple.co/BillyLemos\n'Luv Like' - Nia Archives https://apple.co/NiaArchives\n'Watch Me Now (feat. Koda & VAAAL)' - The Crystal Method https://apple.co/TheCrystalMethod\n'Y Grito' - Angélica Garcia https://apple.co/AngélicaGarcia\n'On the Verge (Safari Riot Remix)' - Skott https://apple.co/Skott\n'UP UP AND AWAY' - ill peach https://apple.co/illpeach\n'Signs' - Saint Mesa & Shells https://apple.co/SaintMesa https://apple.co/Shells\n'Voodoo' - Badshah, J Balvin, Tainy https://apple.co/BadshahJBalvinTainy\n'Selfish Soul' - Sudan Archives https://apple.co/SudanArchives\n'I Can Only Whisper (feat. BADBADNOTGOOD)' - Charlotte Day Wilson https://apple.co/CharlotteDayWilson\n'On The Ground' - Grace Ives https://apple.co/GraceIves\n'Firefly' - Shygirl https://apple.co/Shygirl\n'Big Boy' - Payday https://apple.co/Payday\n'Whatever Tomorrow (Soulwax Remix)' - Chet Faker https://apple.co/ChetFakerSoulwax\n'Where You're Not' - sadie https://apple.co/sadie\n'Found' - Toulouse https://apple.co/Toulouse\n'Biggest' - Idris Elba https://apple.co/IdrisElba\n'THE MOVE' - Space Rangers https://apple.co/SpaceRangers\n'Gravity' - Beach Bunny https://apple.co/BeachBunny\n'Focus' - Malou https://apple.co/Malou\n'He Who Runs With the Flock Inevitably Follows Asses' - Cid Rim https://apple.co/CidRim2022\n'Wild Fantasy' - Guerilla Toss https://apple.co/GuerillaToss\n‘Severance: Main Titles’ - Theodore Shapiro https://apple.co/TheodoreShapiro\n\n想继续欣赏 Apple 特别活动上的音乐，请到 Apple Music 查看特别活动歌单。\n\n#AppleEvent #AppleKeynote\n\niPhone 14、iPhone 14 Plus、iPhone 14 Pro 和 iPhone 14 Pro Max 遵循美国联邦通信委员会 (FCC) 颁布的各项规则，以及美国联邦或州法律的消费者权益保护条款、合同条款及其他相关条款。产品需待 FCC 批准流程完成后方可销售或出货。"
        },
        "fr": {
          "title": "Évènement Apple - 7 septembre",
          "description": "Regardez l’évènement spécial Apple pour découvrir les dernières nouveautés : iPhone 14, iPhone 14 Pro, Apple Fitness+, Apple Watch Ultra, Apple Watch Series 8, AirPods Pro et bien plus.\n\n00:00:00 Introduction\n00:06:40 Apple Watch Series 8\n00:20:17 Apple Watch SE\n00:23:01 Apple Watch Ultra\n00:40:18 AirPods Pro\n00:48:11 iPhone 14\n01:09:27 iPhone 14 Pro\n\n\n'Dancing In The Shadows (feat. Clementine Douglas)' - TSHA https://apple.co/TSHA\n'There You Go' - Billy Lemos https://apple.co/BillyLemos\n'Luv Like' - Nia Archives https://apple.co/NiaArchives\n'Watch Me Now (feat. Koda & VAAAL)' - The Crystal Method https://apple.co/TheCrystalMethod\n'Y Grito' - Angélica Garcia https://apple.co/AngélicaGarcia\n'On the Verge (Safari Riot Remix)' - Skott https://apple.co/Skott\n'UP UP AND AWAY' - ill peach https://apple.co/illpeach\n'Signs' - Saint Mesa & Shells https://apple.co/SaintMesa https://apple.co/Shells\n'Voodoo' - Badshah, J Balvin, Tainy https://apple.co/BadshahJBalvinTainy\n'Selfish Soul' - Sudan Archives https://apple.co/SudanArchives\n'I Can Only Whisper (feat. BADBADNOTGOOD)' - Charlotte Day Wilson https://apple.co/CharlotteDayWilson\n'On The Ground' - Grace Ives https://apple.co/GraceIves\n'Firefly' - Shygirl https://apple.co/Shygirl\n'Big Boy' - Payday https://apple.co/Payday\n'Whatever Tomorrow (Soulwax Remix)' - Chet Faker https://apple.co/ChetFakerSoulwax\n'Where You're Not' - sadie https://apple.co/sadie\n'Found' - Toulouse https://apple.co/Toulouse\n'Biggest' - Idris Elba https://apple.co/IdrisElba\n'THE MOVE' - Space Rangers https://apple.co/SpaceRangers\n'Gravity' - Beach Bunny https://apple.co/BeachBunny\n'Focus' - Malou https://apple.co/Malou\n'He Who Runs With the Flock Inevitably Follows Asses' - Cid Rim https://apple.co/CidRim2022\n'Wild Fantasy' - Guerilla Toss https://apple.co/GuerillaToss\n‘Severance: Main Titles’ - Theodore Shapiro https://apple.co/TheodoreShapiro\n\nVous avez aimé la musique diffusée lors de cet évènement Apple ? Retrouvez la playlist sur Apple Music.\n\n#AppleEvent #AppleKeynote\n\nLes iPhone 14, iPhone 14 Plus, iPhone 14 Pro et iPhone 14 Pro Max sont soumis à la réglementation de la Commission fédérale des communications (FCC) ainsi qu’aux dispositions des lois fédérales ou étatiques en matière de protection des consommateurs et consommatrices, contractuelle ou autre. Ils ne peuvent être vendus ou livrés avant que le processus d’autorisation de la FCC ne soit finalisé."
