        "de": {
          "title": "Apple Event – 7. September",
          "description": "Sieh dir das Apple Special Event an und erfahre alles über das iPhone 14, das iPhone 14 Pro, Apple Fitness+, die Apple Watch Ultra, die Apple Watch Series 8, die AirPods Pro und mehr.\n\nTo watch the event interpreted in American Sign Language (ASL), please click here: [insert link]\n\n0:00:00 Introduction \n0:00:00 Product/Service Name\n0:00:00 Product/Service Name\n“Song Title\" - Artist Name _http://bitlylink_ \n“Song Title\" - Artist Name _http://bitlylink_\n\nHör dir die Tracks vom Apple Event immer wieder an – in der Playlist der Keynote auf Apple Music. \n\n#AppleEvent #AppleKeynote\n\nFür iPhone 14, iPhone 14 Plus, iPhone 14 Pro und iPhone 14 Pro Max gelten FCC Bestimmungen sowie Verbraucherschutz‑ und Vertragsregelungen und andere gesetzliche Verordnungen. Es kann erst verkauft und ausgeliefert werden, wenn die Autorisierung durch die FCC abgeschlossen ist."
