one 14, iPhone 14 Plus, iPhone 14 Pro, 그리고 iPhone 14 Pro Max는 FCC 규약은 물론 소비자 보호 정책, 구매 계약서, 그리고 기타 다른 연방 및 주 법에 명기된 조항을 따릅니다. FCC의 승인 과정이 끝날 때까지 기기를 판매하거나 배송할 수 없습니다."
